export const BooksSettings = {
 MAIN: {
   article: `book`,
   image: {
     imageClass: `book-figure`,
     width: 120,
     height: 175,
   },
   info: ``
 },
 ANNOTATION: {
   article: `annotation`,
   image: {
     imageClass: `annotation-card-picture`,
     width: 220,
     height: 321,
   },
   info: ``
 },
 SUBSCRIPTIONS: {
   article: `favorites__card`,
   image: {
     imageClass: `favorites__image-wrapper`,
     width: 150,
     height: 110,
   },
   info: `favorites__card-info`
 }
};

export const AppRoute = {
 LOGIN: `/login`,
 MAIN: `/`,
 LOGOUT: `/logout`,
 SUBSCRIPTIONS: `/subscriptions`,
 ERROR: `/error`,
 BOOKPAGE: `/book/:id`,
